description:
Mr and Mrs Smith ar ett helt vanligt gift par som lever ett helt vanligt liv i fororten...med det undantaget att de bada har en liten hemlighet de undanhaller den andre: de ar yrkesmordare och arbetar for konkurrerande organisationer.
Vardagslivet stalls pa anda och det somniga aktenskapet hettar till ordentligt nar
det visar sig att bada fatt i uppdrag att doda den andra...
Medverkande: Brad Pitt och Angelina Jolie.

